import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <main className="container">
        <h1>Hello World!</h1>
        <div className="row border border-right-0 border-left-0">
         <div className="col-xs-3"> Title</div>
         <div className="col-xs-2">Genre</div>
         <div className="col-xs-2">Stock</div>
         <div className="col-xs-2">Rate</div>
        </div>
        <div className="row">
         <div className="col-xs-3"> Title</div>
         <div className="col-xs-2">Genre</div>
         <div className="col-xs-2">Stock</div>
         <div className="col-xs-2">Rate</div>
        </div>
      </main>
    );
  }
}

export default App;
